- input: "TEXT\x1CC00369686\x1CSA11C.9725.TEXT\x1CSA11C.9725\x1CSA11C\x1CThis amended
    report correctly attributes $5,000.00 that the Committee to Elect Madeleine Z.
    Bordallo received by check from the Service Employees International Union Committee
    on Political Education (SEIU COPE) on June 30, 2008, as a contribution for the
    general election.  Two separate checks of $5,000.00 each from SEIU COPE were received
    on the same date by the Committee.  The previous reports from the Committee for
    the July Quarter (04/01/2008-06/30/2008) had incorrectly attributed both amounts
    as primary election contributions due to a clerical error.  This report corrects
    that clerical error and is filed in response to the letter from the Federal Election
    Commission (FEC) received by the Committee and dated October 16, 2008."
